import React, { useState, useEffect } from "react";
import { Link, useParams } from "react-router-dom";
import httpClient from "../httpClient";
const Room = () => {
  const [roomMember, setRoomMember] = useState([]);

  const param = useParams();
  // console.log(param);

  useEffect(() => {
    (async () => {
      try {
        const resp = await httpClient.get(
          "//localhost:5000/contract/api/get_room_members",
          { room_id: param.id }
        );
        console.log(resp.response.data);
        setRoomMember(resp.response.data);
      } catch (error) {
        console.log("No room member available");
      }
    })();
  }, []);

  return (
    <>
      <h2>List of Room Member</h2> <br />
      <table>
        <tr>
          <td>
            <b>ID</b>
          </td>
          <td>
            <b>Name</b>
          </td>
          <td>
            <b>Actions</b>
          </td>
        </tr>
        {roomMember && (
          <>
            {roomMember.map((x, index) => {
              return (
                <>
                  <tr key={index}>
                    <td>{x.id}</td>
                    <td>{x.member_name}</td>
                    <td></td>
                  </tr>
                </>
              );
            })}
          </>
        )}
      </table>
      <Link to={`/addmember/${param.id}`}>Add Member</Link>
    </>
  );
};

export default Room;
